import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Image from 'react-bootstrap/Image';
import { useEffect, useState } from "react";

const Header = () => {

  const [url, setUrl] = useState("https://www.themealdb.com/api/json/v1/1/list.php?a=list");
  const[city, setCity] = useState();
  useEffect(() => {
    fetch(url).then(response => response.json())
      .then(data=>{console.log(data.meals);
      setCity(data.meals);
    })
  }, [url]);

  return (
    <>
      <Navbar
        data-bs-theme="light" 
        expand="lg" 
        className="bg-body-tertiary">
        <Container>
          <Navbar.Brand href= "#home">Foodie</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mx-auto">
              <NavDropdown title="Tỉnh thành" id="basic-nav-dropdown">
              {
                  data.map((city)=>{
                    return (
                      <NavDropdown.Item href="#action/HCM">{city.strArea}</NavDropdown.Item>
                    );
                  })}
                
                
              </NavDropdown>
              <NavDropdown title="Danh muc" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Via he</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Nha hang</NavDropdown.Item>
              </NavDropdown>

              <Form className="d-flex">
                <Form.Control
                  type="search"
                  placeholder="Search"
                  className="mx-auto"
                  aria-label="Search"
                />
                <Button variant="outline-success">Search</Button>
              </Form>
            </Nav>
            <Image src="holder.js/171x180" roundedCircle />
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
};

export default Header;
